// C:\Users\user.DESKTOP-9V4975E\const\src\pages\Projects\Projects.js
import React, { useState } from 'react';

const Projects = () => {
  const [activeTab, setActiveTab] = useState('completed');
  const [selectedImage, setSelectedImage] = useState(null);
  const [activeProject, setActiveProject] = useState('all');
  const [activeOngoingProject, setActiveOngoingProject] = useState('all');

  // Projects data arrays remain the same...
  const asokapuramLibrary = ['/uploads/COMPLETED PROJECTS/asokapuram library/1.jpg', /* ... */];
  const colorCode = ['/uploads/COMPLETED PROJECTS/COLOR CODE/2.jpeg', /* ... */];
  const compoundWall = ['/uploads/COMPLETED PROJECTS/compound wall/2.FILE CONCRETE.jpeg', /* ... */];
  const drainage = ['/uploads/COMPLETED PROJECTS/Drainage/1.POOJA.jpeg', /* ... */];
  const poonjolaiGarden = ['/uploads/COMPLETED PROJECTS/POONJOLAI GARDEN - MK GROUP OF COMPANIES KAALAPATTI/1..jpg', /* ... */];
  const roadMarking = ['/uploads/COMPLETED PROJECTS/ROAD MARKING/1.jpeg', /* ... */];
  const vishakaVillas = ['/uploads/COMPLETED PROJECTS/VISHAKA VILLAS/1.1POOJA.jpg', /* ... */];

  // Ongoing projects arrays remain the same...
  const pdShopVellamdai = ['/uploads/ON GOING PROJECTS/PD Shop Vellamdai/1.jpg', /* ... */];
  const newCommercialComplex = ['/uploads/ON GOING PROJECTS/PD Shop Vellamdai/3.jpg', /* ... */];
  const residentialLayout = ['/uploads/ON GOING PROJECTS/PD Shop Vellamdai/6.jpg', /* ... */];
  const highwayExtension = ['/uploads/ON GOING PROJECTS/PD Shop Vellamdai/9.jpg', /* ... */];
  const industrialRoad = ['/uploads/ON GOING PROJECTS/PD Shop Vellamdai/12.jpg', /* ... */];

  const allOngoingProjects = [
    ...pdShopVellamdai, ...newCommercialComplex, ...residentialLayout, 
    ...highwayExtension, ...industrialRoad
  ];

  const allCompletedProjects = [
    ...asokapuramLibrary, ...colorCode, ...compoundWall, ...drainage,
    ...poonjolaiGarden, ...roadMarking, ...vishakaVillas
  ];

  const getOngoingProjectImages = () => {
    switch(activeOngoingProject) {
      case 'pdshop': return pdShopVellamdai;
      case 'commercial': return newCommercialComplex;
      case 'residential': return residentialLayout;
      case 'highway': return highwayExtension;
      case 'industrial': return industrialRoad;
      default: return allOngoingProjects;
    }
  };

  const getProjectImages = () => {
    if (activeTab === 'ongoing') {
      return getOngoingProjectImages();
    }

    switch(activeProject) {
      case 'asokapuram': return asokapuramLibrary;
      case 'colorcode': return colorCode;
      case 'compound': return compoundWall;
      case 'drainage': return drainage;
      case 'poonjolai': return poonjolaiGarden;
      case 'roadmarking': return roadMarking;
      case 'vishaka': return vishakaVillas;
      default: return allCompletedProjects;
    }
  };

  const projectCategories = [
    { id: 'all', name: 'All Projects', count: allCompletedProjects.length },
    { id: 'asokapuram', name: 'Asokapuram Library', count: asokapuramLibrary.length },
    { id: 'poonjolai', name: 'Poonjolai Garden', count: poonjolaiGarden.length },
    { id: 'vishaka', name: 'Vishaka Villas', count: vishakaVillas.length },
    { id: 'drainage', name: 'Drainage Systems', count: drainage.length },
    { id: 'compound', name: 'Compound Walls', count: compoundWall.length },
    { id: 'roadmarking', name: 'Road Marking', count: roadMarking.length },
    { id: 'colorcode', name: 'Color Code', count: colorCode.length }
  ];

  const ongoingCategories = [
    { id: 'all', name: 'All Ongoing', count: allOngoingProjects.length },
    { id: 'pdshop', name: 'PD Shop Vellamdai', count: pdShopVellamdai.length },
    { id: 'commercial', name: 'Commercial Complex', count: newCommercialComplex.length },
    { id: 'residential', name: 'Residential Layout', count: residentialLayout.length },
    { id: 'highway', name: 'Highway Extension', count: highwayExtension.length },
    { id: 'industrial', name: 'Industrial Road', count: industrialRoad.length }
  ];

  return (
    <div className="container">
      {/* Hero Section */}
      <section className="projects-hero">
        <div className="hero-content">
          <h1>Our Projects</h1>
          <p className="hero-subtitle">Showcasing our quality work and successful completions</p>
        </div>
      </section>

      {/* Main Tab Navigation */}
      <section className="projects-tabs">
        <div className="tab-navigation">
          <button 
            onClick={() => setActiveTab('completed')}
            className={`tab-button ${activeTab === 'completed' ? 'active' : ''}`}
          >
            Completed Projects
            <span className="project-count">{allCompletedProjects.length}</span>
          </button>
          <button 
            onClick={() => setActiveTab('ongoing')}
            className={`tab-button ${activeTab === 'ongoing' ? 'active' : ''}`}
          >
            Ongoing Projects
            <span className="project-count">{allOngoingProjects.length}</span>
          </button>
        </div>
      </section>

      {/* Project Filter */}
      <section className="project-filter">
        <div className="filter-container">
          <h3>
            {activeTab === 'completed' ? 'Filter Completed Projects' : 'Filter Ongoing Projects'}
          </h3>
          <div className="filter-buttons">
            {(activeTab === 'completed' ? projectCategories : ongoingCategories).map((category) => (
              <button
                key={category.id}
                onClick={() => activeTab === 'completed' ? setActiveProject(category.id) : setActiveOngoingProject(category.id)}
                className={`filter-btn ${
                  (activeTab === 'completed' && activeProject === category.id) ||
                  (activeTab === 'ongoing' && activeOngoingProject === category.id) ? 'active' : ''
                }`}
              >
                {category.name}
                <span className="count-badge">{category.count}</span>
              </button>
            ))}
          </div>
        </div>
      </section>

      {/* Projects Gallery */}
      <section className="projects-gallery">
        <div className="gallery-header">
          <h2>
            {activeTab === 'completed' ? 'Completed Projects' : 'Ongoing Projects'}
          </h2>
          <p>
            {activeTab === 'completed' 
              ? 'We have successfully completed numerous projects with excellence and precision' 
              : 'Currently working on exciting new projects with the same dedication and quality'
            }
          </p>
        </div>

        <div className="projects-grid">
          {getProjectImages().map((image, index) => (
            <div 
              key={index} 
              className="project-item"
              onClick={() => setSelectedImage(image)}
            >
              <img 
                src={image} 
                alt={`Project ${index + 1}`}
                className="project-image"
              />
              <div className="project-overlay">
                <div className="project-info">
                  <span className="view-text">Click to View</span>
                  <span className="project-number">#{index + 1}</span>
                </div>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Service Areas */}
      <section className="projects-areas">
        <div className="areas-card">
          <h3>Areas We Serve</h3>
          <p>We proudly serve in and around these locations</p>
          <div className="areas-tags">
            <span className="area-tag">Mettupalayam</span>
            <span className="area-tag">Nilgiris</span>
            <span className="area-tag">Coimbatore</span>
            <span className="area-tag">Tiruppur</span>
            <span className="area-tag">Erode</span>
          </div>
          <p className="areas-note">Your trusted construction partner across Tamil Nadu</p>
        </div>
      </section>

      {/* CTA Section */}
      <section className="projects-cta">
        <div className="cta-content">
          <h2>Like What You See?</h2>
          <p>Let's discuss your next construction project</p>
          <div className="cta-buttons">
            <a href="/contact" className="cta-button primary">Start Your Project</a>
            <a href="/services" className="cta-button secondary">Our Services</a>
          </div>
        </div>
      </section>

      {/* Image Modal */}
      {selectedImage && (
        <div className="image-modal" onClick={() => setSelectedImage(null)}>
          <img 
            src={selectedImage} 
            alt="Enlarged view"
            className="modal-image"
          />
        </div>
      )}
    </div>
  );
};

export default Projects;
